// src/components/UserProfileCard.js
import React from 'react';
import { Card, CardHeader, CardContent, Typography, Grid } from '@mui/material';

const UserProfileCard = ({ userData }) => {
  return (
    <Card>
      <CardHeader
        title="User Profile"
        subheader="Details"
        // Centering the profile picture
        sx={{ textAlign: 'center' }}
      />
      <CardContent>
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Typography variant="h6">{userData.name}</Typography>
            <Typography variant="body1">{userData.email}</Typography>
            <Typography variant="body2">Business Type: {userData.businessType}</Typography>
            <Typography variant="body2">Phone Number: {userData.phoneNumber}</Typography>
            <Typography variant="body2">Expected Credit: {userData.expectedCredit}</Typography>
          </Grid>
          <Grid item xs={6}>
            <Typography variant="body2">Business Branches: {userData.businessBranches}</Typography>
            <Typography variant="body2">Company: {userData.company}</Typography>
            <Typography variant="body2">Number of Employees: {userData.numEmployees}</Typography>
            {/* Add any additional fields here */}
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
};

export default UserProfileCard;
